INSERT INTO `notice` VALUES (2,'2021-01-01','layui','layui 针对各种表单元素做了较为全面的UI支持，你无需去书写那些 UI 结构，你只需要写 HTML 原始的 input、select、textarea 这些基本的标签即可。我们在 UI 上的渲染只要求一点，你必须给表单体系所在的父元素加上class=\"layui-form\"，一切的工作都会在你加载完form模块后，自动完成。如下是一个最基本的例子：'),(4,'2021-01-01','osi','OSI（Open System Interconnect），即开放式系统互联。一般都叫OSI参考模型，是ISO（国际标准化组织）组织在1985年研究的网络互连模型。ISO为了更好的使网络应用更为普及，推出了OSI参考模型，这样所有的公司都按照统一的标准来指定自己的网络，就可以互通互联了。\n\n       OSI定义了网络互连的七层框架（物理层、数据链路层、网络层、传输层、会话层、表示层、应用层）。\n'),(41,'2021-01-01','layuinimi','我们通常会在最常用的模块上耗费更多的精力，用尽可能简单的方式诠释 layui 所带来的便捷性。显而易见，form 是我们非常看重的一块。于是它试图用一贯极简的姿态，去捕获你对它的深深青睐。寄托在原始表单元素上的属性设定，及其全自动的初始渲染，和基于事件驱动的接口书写方式，会让你觉得，传统模式下的组件调用形式，也可以是那样的优雅、简单。然而文字的陈述始终是苍白的，所以用行动慢慢感受 layui.form 给你的项目带来的效率提升吧。'),(42,'2021-01-01','HDFS 文件块大小','HDFS 中的文件在物理上是分块存储（block），块的大小可以通过配置参数( dfs.blocksize)来规定，默认大小在 hadoop2.x 版本中是 128M，老版本中是 64M\n\nHDFS 的块比磁盘的块大，其目的是为了最小化寻址开销\n\n如果块设置得足够大，从磁盘传输数据的时间会明显大于定位这个块开始位置所需的时间\n\n因而，传输一个由多个块组成的文件的时间取决于磁盘传输速率\n\n如果寻址时间约为 10ms，而传输速率为 100MB/s，为了使寻址时间仅占传输时间的 1%，我们要将块大小设置约为100MB\n\n块的大小：10ms100100M/s = 100M\n'),(43,'2021-01-01','使用thymeleaf模板引擎时的路径问题','1.如果首字符是“/”\n\n从项目的根目录开始（可以认为是项目下的绝对路径），\n\n2.如果首字符不是“/”，而是直接以目录名开始\n\n以当前路径为参考系（可以认为是项目下以当前路径为参考系的相对路径）'),(45,'2021-10-08','Java 8 Stream','ava 8 API添加了一个新的抽象称为流Stream，可以让你以一种声明的方式处理数据。\n\nStream 使用一种类似用 SQL 语句从数据库查询数据的直观方式来提供一种对 Java 集合运算和表达的高阶抽象。\n\nStream API可以极大提高Java程序员的生产力，让程序员写出高效率、干净、简洁的代码。\n\n这种风格将要处理的元素集合看作一种流， 流在管道中传输， 并且可以在管道的节点上进行处理， 比如筛选， 排序，聚合等。\n\n元素流在管道中经过中间操作（intermediate operation）的处理，最后由最终操作(terminal operation)得到前面处理的结果。');
/*!40000 ALTER TABLE `notice` ENABLE KEYS */;
UNLOCK TABLES;

